import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import LoginPage from './LoginPage';
import ChatbotPage from './ChatbotPage'; // Replace with your Chatbot component

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/chatbot">
            <ChatbotPage />
          </Route>
          <Route path="/">
            <LoginPage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
